import React from 'react';
import RestaurantList from '../components/RestaurantList';
import './HomePage.css'; // Import the CSS file

const HomePage = () => {
    return (
        <div>
            <header className="homepage-header">
                <div className="overlay">
                    <h1 className="site-title">zomato</h1>
                    <p className="site-subtitle">Discover the best food & drinks</p>
                    <div className="search-bar">
                        <input type="text" placeholder="Location" className="location-input"/>
                        <input type="text" placeholder="Search for restaurant, cuisine or a dish" className="search-input"/>
                    </div>
                </div>
            </header>
            <RestaurantList />
        </div>
    );
};

export default HomePage;
